import React from "react";
import "../styles/App.css";

import { FcHome, FcConferenceCall, FcVoicePresentation } from "react-icons/fc";
import Notifications from "./Notification";

function Menu() {
  return (
   
      <nav>
        <a>
          <FcHome /> Home
        </a>
        <a>
          <FcConferenceCall /> Users
        </a>
        <a>
          <FcVoicePresentation />
         Notification
        </a>
      </nav>
  );
}
export default Menu;
